import{_ as e,o as t,c as a,O as s}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 18.2-26 Attempts to commit felonies other than Class 1 felony offenses; how punished.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-26.md","filePath":"vacode/18.2-26.md"}'),n={name:"vacode/18.2-26.md"},o=s('<h1 id="§-18-2-26-attempts-to-commit-felonies-other-than-class-1-felony-offenses-how-punished" tabindex="-1">§ 18.2-26 Attempts to commit felonies other than Class 1 felony offenses; how punished. <a class="header-anchor" href="#§-18-2-26-attempts-to-commit-felonies-other-than-class-1-felony-offenses-how-punished" aria-label="Permalink to &quot;§ 18.2-26 Attempts to commit felonies other than Class 1 felony offenses; how punished.&quot;">​</a></h1><p>Except as provided in § <a href="/vacode/18.2-25/">18.2-25</a>, every person who attempts to commit an offense that is a felony shall be punished as follows:</p><p>(1) If the felony attempted is punishable by a maximum punishment of life imprisonment or a term of years in excess of twenty years, an attempt thereat shall be punishable as a Class 4 felony.</p><p>(2) If the felony attempted is punishable by a maximum punishment of twenty years&#39; imprisonment, an attempt thereat shall be punishable as a Class 5 felony.</p><p>(3) If the felony attempted is punishable by a maximum punishment of less than twenty years&#39; imprisonment, an attempt thereat shall be punishable as a Class 6 felony.</p><p>Code 1950, §§ 18.1-17, 18.1-18; 1960, c. 358; 1975, cc. 14, 15; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0639" target="_blank" rel="noreferrer">639</a>; 2021, Sp. Sess. I, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0344" target="_blank" rel="noreferrer">344</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0345" target="_blank" rel="noreferrer">345</a>.</p>',6),i=[o];function l(r,h,p,f,m,c){return t(),a("div",null,i)}const u=e(n,[["render",l]]);export{_ as __pageData,u as default};
